import React, { useState } from "react";
import { motion } from "framer-motion";
import { Info, Github, X } from "lucide-react";

const projects = [
  {
    title: "GitHub Time-Series Forecasting",
    tech: ["React", "Flask", "Google Cloud", "TensorFlow", "Prophet", "StatsModels", "Docker"],
    github: "https://github.com/yourusername/github-time-series",
    period: "Jan 2024 - Apr 2024",
    achievements: [
      "Built a full-stack app to forecast GitHub metrics using LSTM, Prophet, and StatsModels.",
      "Hosted on Google Cloud using Dockerized microservices.",
      "Leveraged GCP services for data processing and scalable infrastructure."
    ],
  },
  {
    title: "Currency Converter",
    tech: ["Flutter", "Dart", "MVC", "REST API"],
    github: "https://github.com/yourusername/currency-converter",
    period: "May 2024",
    achievements: [
      "Developed a Flutter app using OOP & MVC.",
      "Integrated REST API for real-time exchange rates.",
      "Designed with multi-screen navigation and good scalability."
    ],
  },
  {
    title: "Battleships",
    tech: ["Flutter", "API", "Mobile Game", "Real-time Updates"],
    github: "https://github.com/yourusername/battleships",
    period: "Apr 2024",
    achievements: [
      "Created a mobile game with real-time game list view.",
      "Owned backend integration and optimized API endpoints.",
      "Ensured seamless user experience and efficient protocol handling."
    ],
  },
  {
    title: "Personal Portfolio Website",
    tech: ["React", "Tailwind CSS", "Framer Motion", "JavaScript"],
    github: "https://github.com/yourusername/portfolio",
    period: "Jun 2024",
    achievements: [
      "Built this responsive portfolio using React, Tailwind & Framer Motion.",
      "Animated UI components, structured skill cards, and dark mode integration.",
      "Showcases personal work and highlights experience." 
    ],
  },
];

export default function Projects() {
  const [activeIndex, setActiveIndex] = useState(null);

  return (
    <section id="projects" className="py-20 bg-gray-50">
      <div className="container mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
          className="text-center mb-12"
        >
          <h2 className="text-3xl font-bold gradient-text">Projects</h2>
          <div className="mt-2 h-1 w-20 gradient-bg mx-auto"></div>
        </motion.div>

        <div className="grid md:grid-cols-2 lg:grid-cols-2 gap-8">
          {projects.map((project, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.4, delay: index * 0.1 }}
              className="bg-white rounded-lg shadow-md overflow-hidden hover:shadow-lg transition-shadow"
            >
              <div className="h-48 bg-gray-200 flex items-center justify-center">
                <span className="text-gray-400">Image Placeholder</span>
              </div>

              <div className="p-6">
                <div className="flex justify-between items-center mb-4">
                  <h3 className="text-xl font-bold">{project.title}</h3>
                  <button
                    onClick={() =>
                      setActiveIndex(activeIndex === index ? null : index)
                    }
                    className="text-gray-500 hover:text-primary"
                  >
                    <Info className="h-5 w-5" />
                  </button>
                </div>

                <div className="flex flex-wrap gap-2 mb-4">
                  {project.tech.map((tech, i) => (
                    <span
                      key={i}
                      className="bg-gray-100 px-3 py-1 rounded-full text-sm"
                    >
                      {tech}
                    </span>
                  ))}
                </div>

                <a
                  href={project.github}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="inline-flex items-center text-sm text-blue-600 hover:underline"
                >
                  <Github className="h-4 w-4 mr-1" /> View Code
                </a>
              </div>

              {activeIndex === index && (
                <div className="absolute inset-0 bg-black bg-opacity-50 flex items-center justify-center z-10">
                  <div className="bg-white w-11/12 md:w-2/3 lg:w-1/2 rounded-lg p-6 relative shadow-xl">
                    <button
                      onClick={() => setActiveIndex(null)}
                      className="absolute top-3 right-3 text-gray-500 hover:text-red-500"
                    >
                      <X className="h-5 w-5" />
                    </button>
                    <h4 className="text-xl font-bold mb-1">{project.title}</h4>
                    <p className="text-sm text-gray-500 mb-2">{project.period}</p>
                    <h5 className="font-semibold mt-3 mb-1">Technologies</h5>
                    <div className="flex flex-wrap gap-2 mb-3">
                      {project.tech.map((tech, i) => (
                        <span
                          key={i}
                          className="bg-gray-100 px-3 py-1 rounded-full text-xs"
                        >
                          {tech}
                        </span>
                      ))}
                    </div>
                    <h5 className="font-semibold mb-1">Key Achievements</h5>
                    <ul className="list-disc list-inside text-sm text-gray-700 space-y-1">
                      {project.achievements.map((point, i) => (
                        <li key={i}>{point}</li>
                      ))}
                    </ul>
                  </div>
                </div>
              )}
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
}
